import './App.css';
import { Route, Routes, Navigate } from "react-router-dom";
import Home from './pages/home';
import Login from './pages/login';

function App() {
  return(
    <Routes>
      <Route exact path="/">
        <Navigate to="/login" />
      </Route>
      <Route path="/home" element={Home} />
      <Route path="/login" element={Login} />
    </Routes>
  )
}

export default App;
